import React, { useState, useEffect, useRef } from 'react';
import "../styles/registrationguide.css";

const steps = [
  "Enter GST number",
  "Verify GST number",
  "Enter store name",
  "Enter pickup address",
  "Choose shipping method",
  "Add bank account",
  "List your products",
  "Launch your store",
];

const RegistrationGuide = () => {
  const [activeStep, setActiveStep] = useState(0);
  const sectionsRef = useRef([]);

  // Scroll observer to track which section is in view
  useEffect(() => {
    const handleScroll = () => {
      const offset = window.innerHeight * 0.3; // Adjust this for when the section should be marked
      const index = sectionsRef.current.findIndex((section) => {
        const rect = section.getBoundingClientRect();
        return rect.top >= 0 && rect.top <= offset;
      });
      if (index !== -1) {
        setActiveStep(index);
      }
    };

    window.addEventListener("scroll", handleScroll);
    return () => window.removeEventListener("scroll", handleScroll);
  }, []);

  return (
    <div className="registration-guide">
      <div className="guide-sidebar">
        <h3>Start seller registration</h3>
        <ul className="step-list">
          {steps.map((step, index) => (
            <li
              key={index}
              className={`step-item ${index === activeStep ? "active" : ""}`}
            >
              {step}
            </li>
          ))}
        </ul>
      </div>
      <div className="guide-content">
        <section
          ref={(el) => (sectionsRef.current[0] = el)}
          className="content-section"
        >
          <h2>Start Amazon.in seller registration</h2>
          <p>
            To start registration as a seller on Amazon.in, go to{" "}
            <a href="https://sell.amazon.in" target="_blank" rel="noreferrer">
              sell.amazon.in
            </a>{" "}
            or{" "}
            <a
              href="https://sellercentral.amazon.in"
              target="_blank"
              rel="noreferrer"
            >
              sellercentral.amazon.in
            </a>{" "}
            and click on "Start Selling" to create your account.
          </p>
        </section>
        <section
          ref={(el) => (sectionsRef.current[1] = el)}
          className="content-section"
        >
          <h2>Enter GST number</h2>
          <p>
            Enter your GST number to verify your eligibility as a seller. Make
            sure the GST number is active and linked to your business.
          </p>
        </section>
        <section
          ref={(el) => (sectionsRef.current[2] = el)}
          className="content-section"
        >
          <h2>Verify GST number</h2>
          <p>
            Verification ensures your GST details are correct. You'll be
            notified if there are any discrepancies.
          </p>
        </section>
        <section
          ref={(el) => (sectionsRef.current[3] = el)}
          className="content-section"
        >
          <h2>Enter store name</h2>
          <p>
            Choose a unique name for your store. This will be displayed to
            customers on the marketplace.
          </p>
        </section>
        <section
          ref={(el) => (sectionsRef.current[4] = el)}
          className="content-section"
        >
          <h2>Enter pickup address</h2>
          <p>
            Provide the address where youâ€™ll store your inventory. Amazon will
            use this address for pickups.
          </p>
        </section>
        <section
          ref={(el) => (sectionsRef.current[5] = el)}
          className="content-section"
        >
          <h2>Choose shipping method</h2>
          <p>
            Select your preferred shipping method from Amazon's available
            options.
          </p>
        </section>
        <section
          ref={(el) => (sectionsRef.current[6] = el)}
          className="content-section"
        >
          <h2>Add bank account</h2>
          <p>
            Enter your bank account details to receive payments for your sales.
          </p>
        </section>
        <section
          ref={(el) => (sectionsRef.current[7] = el)}
          className="content-section"
        >
          <h2>List your products</h2>
          <p>
            Start adding your product listings with relevant descriptions and
            pricing.
          </p>
        </section>
        <section
          ref={(el) => (sectionsRef.current[8] = el)}
          className="content-section"
        >
          <h2>Launch your store</h2>
          <p>
            Review all the details and launch your store. Congratulations, you
            are now an Amazon seller!
          </p>
        </section>
      </div>
    </div>
  );
};

export default RegistrationGuide;
